const MainInfoBlock = ({photo_path, name, registration_date}) =>{

    const [photo, setPhoto] = useState();

    return(<Fragment>
        <div className="phases-wrapper">
            <img src={photo} alt=""></img>
            <h1>{name}</h1>
            <p>{registration_date }</p>
        </div>
    </Fragment>);
}

export default MainInfoBlock;
